def get_lib(name, cdll_opts = None):
    libname = None
    if OSNAME == "Linux": 
        libname = "lib" + name + ".so"
    elif OSNAME == "Darwin": 
        libname = "lib" + name + ".dylib"
    elif OSNAME == "Windows": 
        libname = None
    if cdll_opts:
        lib = CDLL(libname, cdll_opts)
    else: 
        lib = CDLL(libname)
    return lib

